export default {
  name: "Languages",

  computed: {
    languages() {
      const { locales } = this.$site;
      if (Object.keys(locales).length > 1) {
        return Object.keys(locales).map(path => {
          const locale = locales[path];
          return {
            ...this.$themeConfig.locales[path].languages,
            path
          };
        });
      }
      return [];
    },

    getCurrentLanguage() {
      return this.$themeLocaleConfig.languages;
    }
  }
};
